import AudioPlayer from "react-h5-audio-player";

const Player = props => (
  <AudioPlayer
    autoPlay
    src="static/audio/{props.name}"
    onPlay={e => console.log("onPlay")}
    // other props here
  />
);

function Index() {
  return (
    <main>
      <img src="static/images/banner.png" alt="The Artefact" />
      <Player name="005_day.mp3" />
    </main>
  );
}

export default Index;
